import React, { useState } from 'react';
import Header from '../components/Header/Header';
import Footer from '../components/Footer/Footer';
import './SellerDashboard.css';

const SellerDashboard = ({ isLoggedIn, userName, userRole, onLoginSuccess, onLogout }) => {
  const [activeTab, setActiveTab] = useState('dashboard');
  const [showAddModal, setShowAddModal] = useState(false);
  const [editingProduct, setEditingProduct] = useState(null);
  const [myProducts, setMyProducts] = useState([
    {
      id: 1,
      name: 'Wireless Headphones Pro',
      category: 'electronics',
      price: 3999,
      discount: 20,
      stock: 50,
      image: 'üéß',
      description: 'Premium wireless headphones with noise cancellation',
      status: 'approved'
    },
    {
      id: 2,
      name: 'Smart Watch Series 5',
      category: 'electronics',
      price: 8999,
      discount: 15,
      stock: 30,
      image: '‚åö',
      description: 'Advanced fitness tracking smartwatch',
      status: 'pending'
    }
  ]);

  const [formData, setFormData] = useState({
    name: '',
    category: 'electronics',
    price: '',
    discount: 0,
    stock: '',
    image: '',
    description: ''
  });

  const categories = [
    { value: 'electronics', label: 'üì± Electronics' },
    { value: 'clothing', label: 'üëï Clothing' },
    { value: 'footwear', label: 'üëü Footwear' },
    { value: 'accessories', label: 'üíç Accessories' },
    { value: 'home-decor', label: 'üè† Home Decor' }
  ];

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleAddProduct = (e) => {
    e.preventDefault();
    const newProduct = {
      id: Date.now(),
      ...formData,
      price: parseFloat(formData.price),
      discount: parseFloat(formData.discount),
      stock: parseInt(formData.stock),
      status: 'pending'
    };
    setMyProducts([...myProducts, newProduct]);
    setShowAddModal(false);
    setFormData({ name: '', category: 'electronics', price: '', discount: 0, stock: '', image: '', description: '' });
    alert('Product submitted for admin approval!');
  };

  const handleEditProduct = (product) => {
    setEditingProduct(product);
    setFormData({
      name: product.name,
      category: product.category,
      price: product.price,
      discount: product.discount,
      stock: product.stock,
      image: product.image,
      description: product.description
    });
    setShowAddModal(true);
  };

  const handleUpdateProduct = (e) => {
    e.preventDefault();
    const updatedProducts = myProducts.map(p => 
      p.id === editingProduct.id 
        ? { 
            ...p, 
            ...formData, 
            price: parseFloat(formData.price),
            discount: parseFloat(formData.discount),
            stock: parseInt(formData.stock),
            status: 'pending' 
          }
        : p
    );
    setMyProducts(updatedProducts);
    setShowAddModal(false);
    setEditingProduct(null);
    setFormData({ name: '', category: 'electronics', price: '', discount: 0, stock: '', image: '', description: '' });
    alert('Product updated and submitted for admin approval!');
  };

  const handleDeleteProduct = (id) => {
    if (window.confirm('Are you sure you want to delete this product?')) {
      setMyProducts(myProducts.filter(p => p.id !== id));
      alert('Product deleted successfully!');
    }
  };

  const closeModal = () => {
    setShowAddModal(false);
    setEditingProduct(null);
    setFormData({ name: '', category: 'electronics', price: '', discount: 0, stock: '', image: '', description: '' });
  };

  const stats = {
    total: myProducts.length,
    approved: myProducts.filter(p => p.status === 'approved').length,
    pending: myProducts.filter(p => p.status === 'pending').length,
    rejected: myProducts.filter(p => p.status === 'rejected').length
  };

  return (
    <div className="seller-dashboard-page">
      <Header 
        cartCount={0} 
        onLoginClick={() => {}}
        isLoggedIn={isLoggedIn}
        userName={userName}
        userRole={userRole}
        onLogout={onLogout}
      />

      <div className="seller-dashboard">
        <div className="dashboard-header">
          <h1>üè™ Seller Dashboard</h1>
          <p>Welcome, {userName}!</p>
        </div>

        <div className="stats-grid">
          <div className="stat-card total">
            <div className="stat-icon">üì¶</div>
            <div className="stat-info">
              <h3>{stats.total}</h3>
              <p>Total Products</p>
            </div>
          </div>
          <div className="stat-card approved">
            <div className="stat-icon">‚úÖ</div>
            <div className="stat-info">
              <h3>{stats.approved}</h3>
              <p>Approved</p>
            </div>
          </div>
          <div className="stat-card pending">
            <div className="stat-icon">‚è≥</div>
            <div className="stat-info">
              <h3>{stats.pending}</h3>
              <p>Pending</p>
            </div>
          </div>
          <div className="stat-card rejected">
            <div className="stat-icon">‚ùå</div>
            <div className="stat-info">
              <h3>{stats.rejected}</h3>
              <p>Rejected</p>
            </div>
          </div>
        </div>

        <div className="dashboard-actions">
          <button className="add-product-btn" onClick={() => setShowAddModal(true)}>
            ‚ûï Add New Product
          </button>
        </div>

        <div className="products-section">
          <h2>My Products</h2>
          <div className="products-grid">
            {myProducts.length === 0 ? (
              <div className="empty-state">
                <p>üì¶ No products yet. Add your first product!</p>
              </div>
            ) : (
              myProducts.map(product => (
                <div key={product.id} className="seller-product-card">
                  <div className={`product-status ${product.status}`}>
                    {product.status === 'approved' && '‚úÖ Approved'}
                    {product.status === 'pending' && '‚è≥ Pending'}
                    {product.status === 'rejected' && '‚ùå Rejected'}
                  </div>
                  <div className="product-image">{product.image}</div>
                  <div className="product-details">
                    <h3>{product.name}</h3>
                    <p className="product-category">
                      {categories.find(c => c.value === product.category)?.label}
                    </p>
                    <p className="product-description">{product.description}</p>
                    <div className="product-price-info">
                      <span className="price">‚Çπ{product.price}</span>
                      {product.discount > 0 && (
                        <span className="discount">{product.discount}% OFF</span>
                      )}
                    </div>
                    <p className="product-stock">Stock: {product.stock} units</p>
                  </div>
                  <div className="product-actions">
                    <button 
                      className="edit-btn" 
                      onClick={() => handleEditProduct(product)}
                    >
                      ‚úèÔ∏è Edit
                    </button>
                    <button 
                      className="delete-btn" 
                      onClick={() => handleDeleteProduct(product.id)}
                    >
                      üóëÔ∏è Delete
                    </button>
                  </div>
                </div>
              ))
            )}
          </div>
        </div>
      </div>

      {showAddModal && (
        <div className="modal-overlay" onClick={closeModal}>
          <div className="product-modal" onClick={(e) => e.stopPropagation()}>
            <div className="modal-header">
              <h2>{editingProduct ? '‚úèÔ∏è Edit Product' : '‚ûï Add New Product'}</h2>
              <button className="close-btn" onClick={closeModal}>‚úï</button>
            </div>
            <form onSubmit={editingProduct ? handleUpdateProduct : handleAddProduct}>
              <div className="form-row">
                <div className="form-group">
                  <label>Product Name *</label>
                  <input
                    type="text"
                    name="name"
                    value={formData.name}
                    onChange={handleInputChange}
                    required
                    placeholder="Enter product name"
                  />
                </div>
                <div className="form-group">
                  <label>Category *</label>
                  <select
                    name="category"
                    value={formData.category}
                    onChange={handleInputChange}
                    required
                  >
                    {categories.map(cat => (
                      <option key={cat.value} value={cat.value}>
                        {cat.label}
                      </option>
                    ))}
                  </select>
                </div>
              </div>

              <div className="form-group">
                <label>Description *</label>
                <textarea
                  name="description"
                  value={formData.description}
                  onChange={handleInputChange}
                  required
                  placeholder="Enter product description"
                  rows="3"
                />
              </div>

              <div className="form-row">
                <div className="form-group">
                  <label>Price (‚Çπ) *</label>
                  <input
                    type="number"
                    name="price"
                    value={formData.price}
                    onChange={handleInputChange}
                    required
                    min="1"
                    placeholder="0"
                  />
                </div>
                <div className="form-group">
                  <label>Discount (%)</label>
                  <input
                    type="number"
                    name="discount"
                    value={formData.discount}
                    onChange={handleInputChange}
                    min="0"
                    max="100"
                    placeholder="0"
                  />
                </div>
                <div className="form-group">
                  <label>Stock *</label>
                  <input
                    type="number"
                    name="stock"
                    value={formData.stock}
                    onChange={handleInputChange}
                    required
                    min="0"
                    placeholder="0"
                  />
                </div>
              </div>

              <div className="form-group">
                <label>Product Emoji/Icon *</label>
                <input
                  type="text"
                  name="image"
                  value={formData.image}
                  onChange={handleInputChange}
                  required
                  placeholder="Enter emoji (e.g., üéß, üì±, üëï)"
                  maxLength="2"
                />
              </div>

              <div className="form-actions">
                <button type="button" className="cancel-btn" onClick={closeModal}>
                  Cancel
                </button>
                <button type="submit" className="submit-btn">
                  {editingProduct ? 'Update Product' : 'Add Product'}
                </button>
              </div>
            </form>
          </div>
        </div>
      )}

      <Footer />
    </div>
  );
};

export default SellerDashboard;
